INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 24015, 1, "2030/12/17 14:59:59", 0.0, 10021, 24, 4, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 4.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 1, 24016, 2, "2030/12/17 14:59:59", 0.0, 10021, 24, 4, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 24017, 3, "2030/12/17 14:59:59", 0.0, 10021, 24, 4, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 5.2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 2, 24018, 4, "2030/12/17 14:59:59", 0.0, 10021, 24, 1, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 4.2, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 6, 24019, 5, "2030/12/17 14:59:59", 0.0, 10021, 24, 5, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 24020, 6, "2030/12/17 14:59:59", 0.0, 10021, 24, 2, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 6.4, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 6, 24021, 7, "2030/12/17 14:59:59", 0.0, 10021, 24, 1, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 24022, 8, "2030/12/17 14:59:59", 0.0, 10021, 24, 2, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 10.08, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 3, 24023, 9, "2030/12/17 14:59:59", 0.0, 10021, 24, 6, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 5.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 2, 24024, 10, "2030/12/17 14:59:59", 0.0, 10021, 24, 1, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (0.0, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 24025, 11, "2030/12/17 14:59:59", 0.0, 10021, 24, 2, "2019/07/31 12:00:00", 110501, "カオリ（サマー）");
